import React from 'react';
import './Achievements.css';

const Achievements = () => {
  const achievements = {
    certifications: [
      "Web Development Bootcamp - Udemy",
      "React.js Advanced Concepts - Coursera",
      "Full Stack Development - FreeCodeCamp"
    ],
    awards: [
      "Best Project Award - College Tech Fest 2023",
      "Coding Competition Winner - Hackathon 2023",
      "Excellence in Academic Performance"
    ]
  };

  return (
    <section className="achievements" id="achievements">
      <div className="achievements-header">
        <h2>Achievements & Certifications</h2>
        <p>Milestones Along My Journey</p>
      </div>
      
      <div className="circles-container">
        <div className="circle certifications">
          <div className="circle-content">
            <h3>Certifications</h3>
            <ul>
              {achievements.certifications.map((cert, index) => (
                <li key={index}>{cert}</li>
              ))}
            </ul>
          </div>
        </div>
        
        <div className="circle awards">
          <div className="circle-content">
            <h3>Awards</h3>
            <ul>
              {achievements.awards.map((award, index) => (
                <li key={index}>{award}</li>
              ))}
            </ul>
          </div>
        </div>
      </div>
    </section>
  );
};

export default Achievements;
